function ggbOnInit(param) {
	if (param == "ggbApplet") {
		// init update listeners for ggbApplet1
		ggbApplet.registerObjectUpdateListener("toith", "abcListener");
		ggbApplet.registerObjectUpdateListener("toitR", "abcListener");
		ggbApplet.registerObjectUpdateListener("rayon", "abcListener");
                ggbApplet.registerObjectUpdateListener("hauteur", "abcListener");
                ggbApplet.registerObjectUpdateListener("x_46", "abcListener");
		ggbApplet.registerObjectUpdateListener("o", "abcListener");
                ggbApplet.registerObjectUpdateListener("o_5", "abcListener");
                ggbApplet.registerObjectUpdateListener("x_q", "abcListener");
                ggbApplet.registerObjectUpdateListener("nombree", "abcListener");
                ggbApplet.registerObjectUpdateListener("x_52", "abcListener");
                ggbApplet.registerObjectUpdateListener("v_5", "abcListener");
                ggbApplet.registerObjectUpdateListener("x_102", "abcListener");
                ggbApplet.registerObjectUpdateListener("w", "abcListener");
                ggbApplet.registerObjectUpdateListener("u_{14}", "abcListener");
                ggbApplet.registerObjectUpdateListener("x_67", "abcListener");
                ggbApplet.registerObjectUpdateListener("v", "abcListener");
                ggbApplet.registerObjectUpdateListener("x_76", "abcListener");
               }
}
 
function abcListener(objName) {
      // get value from applet1 and set value in applet2	
	var changedValue = ggbApplet.getValue(objName);            
	ggbApplet2.setValue(objName, changedValue);
        ggbApplet3.setValue(objName, changedValue);
        ggbApplet4.setValue(objName, changedValue);
}
 




